import React from 'react';
import './Menu.css';

function Menu({ menuEntry, onSelect }) {
    console.log(menuEntry)
    return (
        <div className="menu">
            Object.keys(menuEntry).forEach(key => {
                <button onClick={() => onSelect({key})}>Characters</button>
            })
        </div>
    );
}

export default Menu;
